import React from "react";

const Header = ({ course }) => {
  return <h1>{course}</h1>;
};

const Part = (props) => {
  return (
    <p>
      {props.part.name} {props.part.exercises}
    </p>
  );
};

const Content = (props) => {
  return (
    <>
      <Part part={props[0]} />
      <Part part={props[1]} />
      <Part part={props[2]} />
    </>
  );
};

const Total = (props) => {
  return (
    <p>
      Number of exercises{" "}
      {props.exercises1 + props.exercises2 + props.exercises3}
    </p>
  );
};

const App = () => {
  const course = "Half Stack application development";
const parts = [
  {
    name: "Fundamentals of React",
    exercises: 10,
  },
  {
    name: "Using props to pass data",
    exercises: 7,
  },
  {
    name: "State of a component",
    exercises: 14,
  },
];

  return (
    <div>
      <Header course={course} />
      <Content value={parts} />
      {/* <Total value={parts} /> */}
    </div>
  );
};

export default App;
